import { NavLink, Outlet } from "react-router-dom";

const UserListLayout = () => {
  return (
    <div className="user-layout">
      <nav className="list-links">
        <NavLink to={"/watchlater"}></NavLink>
        <NavLink to={"favourites"}></NavLink>
      </nav>


      <Outlet />
    </div>
  );
}

export default UserListLayout;
